import React from "react";

//import reactstrap
import {
  Card,
  CardBody,
  Container,
  Row,
  Col,
  Button,
  Form,
  CardHeader,
} from "reactstrap";

// core components
import SimpleHeader from "components/Headers/SimpleHeader.js";

import { ToastContainer, toast } from "react-toastify";
import TextArea from "antd/lib/input/TextArea";
// import TextArea from "antd/lib/input/TextArea";

function FAQ() {
  const handleSubmitForm = (e) => {
    e.preventDefault();
    try {
      toast.success("Successfull");
    } catch (err) {
      toast.error("Failed!");
    }
  };

  return (
    <>
      <SimpleHeader name="FAQ" />
      <ToastContainer
        position="bottom-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="colored"
      />
      <Container className="mt--6" align="center">
        <Col lg="6">
          <Card>
            <CardHeader>
              <h1>Queary</h1>
            </CardHeader>
            <Form onSubmit={handleSubmitForm}>
              <CardBody>
                <Row>
                  <Col>
                    <TextArea
                      className="w-100"
                      type="text"
                      placeholder="Queary..."
                      required
                    />
                  </Col>
                </Row>
              </CardBody>
              <Row className="mb-4">
                <Col>
                  <Button type="submit" color="success">
                    Submit
                  </Button>
                </Col>
              </Row>
            </Form>
          </Card>
        </Col>
      </Container>
    </>
  );
}

export default FAQ;
